import React from 'react';

export default class HedF extends React.Component {
  render() {
    return (
      <div className='hedf'>
        <div div className='hedf2'>
          <h3>EU LEO CURABITUR ELEIFEND SAPIEN</h3>
          <h2>Sed Eros Nullam Quis Ligula</h2>
          <p>
            Elementum lectus varius aliquet quisque fringilla est in porttitor
          </p>
          <div className='hedfspan'>
            <span>Ultricies dui orci</span>
            <span>Mollis libero quis</span>
          </div>
        </div>
      </div>
    );
  }
}
